VALUES ('20859688', 'chleb żytni', 'Chleb żytni z pełnego ziarna żyia,razowy, krojony, pasteryzowany. Bez dodatku substancji konserwujących. Składniki: 35.2% ziarna żyta tamane, woda, 21% zakwas żytni (10,5% maka żytnia razowa - w zakwasie żytnim, woda), 15,8% mąka żytnia razowa, ziemniak suszony, sól. Może zawierać: jaja, soję, nasiona sezamu, mleko oraz orzeszki arachidowe. Najlepiej spożyć przed/ nr partii: patrz nadruk obok etykiety, data minimalnej trwałości jest jednocześnie numerem partii. Przechowywać w temperaturze pokojowej w suchym miejscu. Po otwarciu zaleca się spożyć w ciagu 3 dni Wyprodukowano w Polsce. Lidl sp. z o.o.sp. k. ul. Poznańska 48, Jankowice 62-080 Tarmowo Podgórne', 'https://static.openfoodfacts.org/images/products/20859688/front_pl.4.400.jpg', '1.4', '0.2', '37', '5.1', '9.2', '5.3', '0.92', '0.362204724409449', '0', '1');

